import React, { Component } from 'react'
import { Route } from 'react-router-dom'

const ProtectedRoute = ({component: Component, ...rest}) =>{


    return(

        <Route {...rest} render= {
            props => <Component{...rest}{...props} />
         } />
    )
}
export default ProtectedRoute;
